def dot(arr1, arr2):
    if len(arr1[0]) != len(arr2):
        print("Sizes don't match")
        return
    ret = [[0 for i in range(len(arr2[0]))] for j in range(len(arr1))]
    for i in range(len(arr1)):
        for j in range(len(arr2[0])):
            for k in range(len(arr1[0])):
                ret[i][j] += arr1[i][k] * arr2[k][j]
    return ret

def add(arr1, arr2):
    if len(arr1) != len(arr2) or len(arr1[0]) != len(arr2[0]):
        print("Sizes don't match")
        return
    for i in range(len(arr1)):
        for j in range(len(arr1[0])):
            arr1[i][j] += arr2[i][j]
    return arr1

def relu(arr):
    for i in range(len(arr)):
        arr[i][0] = max(0, arr[i][0])
    return arr

def sofm(arr):
    ttl = 0
    for i in range(len(arr)):
        arr[i][0] = math.exp(arr[i][0])
        ttl += arr[i][0]
    for i in range(len(arr)):
        arr[i][0] /= ttl
    return arr

def argm(arr):
    ret = -1
    mx = -1
    for i in range(len(arr)):
        if arr[i][0] > mx:
            mx = arr[i][0]
            ret = i
    return ret

